import React from 'react';
import { Link } from "react-router-dom";
import logo from '../img/logo.svg';

function Gusto() {
  return (
    <main className="pt-16">
      <div className="max-w-6xl mx-auto flex flex-col items-center md:px-6">
        <h3>2016</h3>
        <h1>Gusto Health Benefits</h1>
      </div>
    </main>
  );
}

export default Gusto;
